    const onEdit=() => {
        props.handleEdit(props.booking.id)
    }

    if(!props.Booking){
        return null
    }

    return(
        <div>
            <div className="booking-item-basic-details">
                <h4>Booking Basic Info:</h4>
                <h6>Booking Id: {props.booking.id}</h6>
                <h6>Booking Date: {props.booking.date}</h6> 


                <h6></h6>
            </div>


        </div>

    )
}
